import React from 'react';
import "../css/cadr.css";

const Nudime = () => {
    return ( 
        <div className="nudime">
         <h1>Нудиме</h1>
         <span className="black-span"><i class="fa fa-globe" aria-hidden="true"></i>Простор</span>
         <span className="black-span">Space Kitchen</span>
         <span className="black-span">Логистика</span>
         <span className="black-span">Техничка Поддршка</span>
         <span className="black-span"><i class="fa fa-volume-up" aria-hidden="true"></i>Звук</span>
         <span className="black-span">Светло</span>
         <span className="black-span">Помош при Организација</span>
         <span className="black-span">Видео и Фотографија</span>
         <span className="black-span">Промоција на Социјални Мрежи</span>
        </div>
     );
}
 
export default Nudime;
